import React from 'react';
import PostDirectory from './PostDirectory.js';
import LogId from './LogId.js';

const logIdComponent = new LogId(this.props.recordId);
const postDirectory = new PostDirectory();
const recordId = (props.recordId === null) ? this.logIdComponent.generateNewLogId() : props.recordId
const log = (JSON.parse(localStorage.getItem(recordId)) === null) ? logIdComponent.templateData : JSON.parse(localStorage.getItem(recordId))
const getDate = () => log.Day.Date;
console.log(`LogData => render: recordId: ${recordId} - log: ${log}`);

const LogData = props =>  <p>Count: {postDirectory.length}</p>;
export default LogData;
